import React from "react";

function Note(props){
    return (
        <div className="note">
            <h1>{props.title}</h1>
            <p>{props.content}</p>
        </div>
    );
}

function NoteInput(props){
    return (
        <div>
            <div className="noteInput">
                <input type="text" value="" placeholder="Title"></input>
                <input type="text" value="" placeholder="Take a note..."></input>
            </div>
                <button onClick={props.addNote} type="submit">Add</button>
        </div>

    );
}

export default Note;
export {NoteInput};
